import React from 'react'
import Header from '../components/Header'
import Container from '../components/Container'
import {Box, Grid} from '@material-ui/core';

export default function Landing () {

    return (
        <Container>
            <Grid>
            <Box justifyContent="flex-end">
                <Header></Header>
            </Box>
            </Grid>
        </Container>
    )
}
